import React from 'react';
import MapBe from '../MapBe';
import bivakzones from '../bivakzones.json';
import { Map as LeafletMap, TileLayer } from 'react-leaflet';



export default function WcList(props) {
    console.log(bivakzones)



    return (
        <div>
            <LeafletMap>

                {bivakzones.features
                    .map((bivakzone) => {
                        console.log(bivakzone)
                        if (bivakzone.geometry.type === 'Point') {
                            return (bivakzone)

                        } else {
                            bivakzone.geometry.coordinates =
                                bivakzone.geometry.coordinates[0][0]
                            bivakzone.geometry.type = 'Point'
                            return (bivakzone)
                        }
                    })}
                <TileLayer />
            </LeafletMap>
        </div>
    )

}
